    function process() {
        $.when({!! implode(', ', $functions) !!}).then(function(){
            $('#page-content').attr('data-full', true);
        });
    }

    function applyZoom() {
        let el = document.getElementById('page-content');
        el.style.width = (window.screen.width - 32)/config.zoom + 'px';
        transformOrigin = [0,0];
        el = el || instance.getContainer();
        var p = ["webkit", "moz", "ms", "o"],
            s = "scale(" + config.zoom + ")",
            oString = (transformOrigin[0] * 100) + "% " + (transformOrigin[1] * 100) + "%";

        for (var i = 0; i < p.length; i++) {
            el.style[p[i] + "Transform"] = s;
            el.style[p[i] + "TransformOrigin"] = oString;
        }

        el.style["transform"] = s;
        el.style["transformOrigin"] = oString;
    }

    function applyLight() {
        if (config.light > 0) {
            let contrast = 100 - config.light;
            $('#page-content').css('filter', 'brightness(' + config.light + '%)');
        }
    }

    function setLight(value) {
        config.light = value;
        applyLight();
    }
    function setPage(page) {
        console.log(page);
        abt.innerHTML = page + ' из ' + config.totalPage;
        config.page = page;
    }

    function flashMessage(message, textonly = true) {
        $.mobile.loading("show", {
            text: message,
            textVisible: true,
            textonly: textonly,
            theme: "b",
            inline: true
        });
        setTimeout(function () {
            $.mobile.loading("hide");
        }, 1300);
    }

    function fallbackCopyTextToClipboard(text) {
        var textArea = document.createElement("textarea");
        textArea.value = text;

        // Avoid scrolling to bottom
        textArea.style.top = "0";
        textArea.style.left = "0";
        textArea.style.position = "fixed";

        document.body.appendChild(textArea);
        textArea.focus();
        textArea.select();

        try {
            var successful = document.execCommand('copy');
            var msg = successful ? 'successful' : 'unsuccessful';
            console.log('Fallback: Copying text command was ' + msg);
        } catch (err) {
            console.error('Fallback: Oops, unable to copy', err);
        }

        document.body.removeChild(textArea);
    }

    function copyTextToClipboard(text) {
        if (!navigator.clipboard) {
            fallbackCopyTextToClipboard(text);
            return;
        }
        navigator.clipboard.writeText(text).then(function () {
            console.log('Async: Copying to clipboard was successful!');
        }, function (err) {
            console.error('Async: Could not copy text: ', err);
        });
    }

    function selectText(menu) {
        var s = document.getSelection(),
            r = s.getRangeAt(0);
        if (r && s.toString()) {
            $('input[name="text"]').val(s.toString().trim());
            var p = r.getBoundingClientRect();
            if (p.left || p.top) {
                let left = (p.left + (p.width / 2)) - (menu.width() / 2);
                menu.css({
                    left: (left > 0) ? left : 0,
                    top: ((p.top + window.scrollY) - menu.height() - 10),
                    display: 'block',
                    opacity: 0
                })
                    .animate({
                        opacity: 1
                    }, 300);

                setTimeout(function () {
                    menu.addClass('highlight_menu_animate');
                }, 10);
                return;
            }
        }
        menu.animate({opacity: 0}, function () {
            menu.hide().removeClass('highlight_menu_animate');
        });
    }
